                                                        ),
                                                    "\n",
                                                    _p.Content(
                                                        _b.Content(
                                                            "HTML5"
                                                        ),
                                                        _sup._id("cite_ref-name_4-0")
                                                            ._class("reference")
                                                            .Content(
                                                                _a._href("#cite_note-name-4")
                                                                    .Content(
                                                                        "[a]"
                                                                    )
                                                            ),
                                                        " is a ",
                                                        _a._href("/wiki/Markup_language")
                                                            ._title("Markup language")
                                                            .Content(
                                                                "markup language"
                                                            ),
                                                        " used for structuring and presenting content on the ",
                                                        _a._href("/wiki/World_Wide_Web")
                                                            ._title("World Wide Web")
                                                            .Content(
                                                                "World Wide Web"
                                                            ),
                                                        ". It is the fifth and current version of the ",
                                                        _a._href("/wiki/HTML")
                                                            ._title("HTML")
                                                            .Content(
                                                                "HTML"
                                                            ),
                                                        " standard."
                                                    ),
                                                    "\n",
                                                    _p.Content(
                                                        "It was published in October 2014 by the ",
                                                        _a._href("/wiki/World_Wide_Web_Consortium")
                                                            ._title("World Wide Web Consortium")
                                                            .Content(
                                                                "World Wide Web Consortium"
                                                            ),
                                                        " (W3C)",
                                                        _sup._id("cite_ref-finalars_2-1")
                                                            ._class("reference")
                                                            .Content(
                                                                _a._href("#cite_note-finalars-2")
                                                                    .Content(
                                                                        "[2]"
                                                                    )
                                                            ),
                                                        _sup._id("cite_ref-5")
                                                            ._class("reference")
                                                            .Content(
                                                                _a._href("#cite_note-5")
                                                                    .Content(
                                                                        "[4]"
                                                                    )
                                                            ),
                                                        " to improve the language with support for the latest multimedia, while keeping it both easily readable by humans and consistently understood by computers and devices such as ",
                                                        _a._href("/wiki/Web_browser")
                                                            ._title("Web browser")
                                                            .Content(
                                                                "web browsers"
                                                            ),
                                                        ", ",
                                                        _a._href("/wiki/Parsing")
                                                            ._title("Parsing")
                                                            .Content(
                                                                "parsers"
                                                            ),
                                                        ", etc. HTML5 is intended to subsume not only ",
                                                        _a._href("/wiki/HTML_4")
                                                            ._class("mw-redirect")
                                                            ._title("HTML 4")
                                                            .Content(
                                                                "HTML 4"
                                                            ),
                                                        ", but also ",
                                                        _a._href("/wiki/XHTML")
                                                            ._title("XHTML")
                                                            .Content(
                                                                "XHTML"
                                                            ),
                                                        " 1 and ",
                                                        _a._href("/wiki/Document_Object_Model")
                                                            ._title("Document Object Model")
                                                            .Content(
                                                                "DOM Level 2 HTML"
                                                            ),
                                                        ".",
                                                        _sup._id("cite_ref-HTML5-20110405_6-0")
                                                            ._class("reference")
                                                            .Content(
                                                                _a._href("#cite_note-HTML5-20110405-6")
                                                                    .Content(
                                                                        "[5]"
                                                                    )
                                                            )
                                                    ),
                                                    "\n",
                                                    _p.Content(
                                                        "HTML5 includes detailed processing models to encourage more interoperable implementations; it extends, improves and rationalizes the markup available for documents, and introduces markup and ",
                                                        _a._href("/wiki/Application_programming_interfaces")
                                                            ._class("mw-redirect")
                                                            ._title("Application programming interfaces")
                                                            .Content(
                                                                "application programming interfaces"
                                                            ),
                                                        " (APIs) for complex ",
                                                        _a._href("/wiki/Web_application")
                                                            ._title("Web application")
                                                            .Content(
                                                                "web applications"
                                                            ),
                                                        ".",
                                                        _sup._id("cite_ref-HTML5diffHTML4_7-0")
                                                            ._class("reference")
                                                            .Content(
                                                                _a._href("#cite_note-HTML5diffHTML4-7")
                                                                    .Content(
                                                                        "[6]"
                                                                    )
                                                            ),
                                                        " For the same reasons, HTML5 is also ",
                                                        _a._href("/wiki/HTML5_in_mobile_devices")
                                                            ._title("HTML5 in mobile devices")
                                                            .Content(
                                                                "a candidate for cross-platform mobile applications"
                                                            ),
                                                        ", because it includes features designed with low-powered devices in mind."
                                                    ),
                                                    "\n",
                                                    _p.Content(
                                                        "Many new ",
                                                        _a._href("/wiki/Syntax_(programming_languages)")
                                                            ._title("Syntax (programming languages)")
                                                            .Content(
                                                                "syntactic"
                                                            ),
                                                        " features are included. To natively include and handle ",
                                                        _a._href("/wiki/Multimedia")
                                                            ._title("Multimedia")
                                                            .Content(
                                                                "multimedia"
                                                            ),
                                                        " and ",
                                                        _a._href("/wiki/2D_computer_graphics")
                                                            ._title("2D computer graphics")
                                                            .Content(
                                                                "graphical"
                                                            ),
                                                        " content, the new ",
                                                        _code.Content(
                                                            _a._href("/wiki/HTML5_video")
                                                                ._title("HTML5 video")
                                                                .Content(
                                                                    "<video>"
                                                                )
                                                        ),
                                                        ", ",
                                                        _code.Content(
                                                            _a._href("/wiki/HTML5_Audio")
                                                                ._title("HTML5 Audio")
                                                                .Content(
                                                                    "<audio>"
                                                                )
                                                        ),
                                                        " and ",
                                                        _code.Content(
                                                            _a._href("/wiki/Canvas_element")
                                                                ._title("Canvas element")
                                                                .Content(
                                                                    "<canvas>"
                                                                )
                                                        ),
                                                        " ",
                                                        _a._href("/wiki/HTML_element")
                                                            ._title("HTML element")
                                                            .Content(
                                                                "elements"
                                                            ),
                                                        " were added, and support for scalable vector graphics (",
                                                        _a._href("/wiki/Scalable_Vector_Graphics")
                                                            ._title("Scalable Vector Graphics")
                                                            .Content(
                                                                "SVG"
                                                            ),
                                                        ") content and ",
                                                        _a._href("/wiki/MathML")
                                                            ._title("MathML")
                                                            .Content(
                                                                "MathML"
                                                            ),
                                                        " for mathematical formulas. To enrich the ",
                                                        _a._href("/wiki/Semantic_web")
                                                            ._class("mw-redirect")
                                                            ._title("Semantic web")
                                                            .Content(
                                                                "semantic"
                                                            ),
                                                        " content of documents, new page structure elements such as ",
                                                        _code.Content(
                                                            "<main>"
                                                        ),
                                                        ", ",
                                                        _code.Content(
                                                            "<section>"
                                                        ),
                                                        ", ",
                                                        _a._href("/wiki/Article_element_(HTML5)")
                                                            ._title("Article element (HTML5)")
                                                            .Content(
                                                                _code.Content(
                                                                    "<article>"
                                                                )
                                                            ),
                                                        ", ",
                                                        _code.Content(
                                                            "<header>"
                                                        ),
                                                        ", ",
                                                        _code.Content(
                                                            "<footer>"
                                                        ),
                                                        ", ",
                                                        _code.Content(
                                                            "<aside>"
                                                        ),
                                                        ", ",
                                                        _code.Content(
                                                            "<nav>"
                                                        ),
                                                        " and ",
                                                        _code.Content(
                                                            "<figure>"
                                                        ),
                                                        ", are added. New ",
                                                        _a._href("/wiki/HTML_attribute")
                                                            ._title("HTML attribute")
                                                            .Content(
                                                                "attributes"
                                                            ),
                                                        " are introduced, some elements and attributes have been removed, and others such as ",
                                                        _code.Content(
                                                            "<a>"
                                                        ),
                                                        ", ",
                                                        _code.Content(
                                                            "<cite>"
                                                        ),
                                                        " and ",
                                                        _code.Content(
                                                            "<menu>"
                                                        ),
                                                        " have been changed, redefined or standardized."
                                                    ),
                                                    "\n",
                                                    _p.Content(
                                                        "The APIs and ",
                                                        _a._href("/wiki/Document_Object_Model")
                                                            ._title("Document Object Model")
                                                            .Content(
                                                                "Document Object Model"
                                                            ),
                                                        " (DOM) are now fundamental parts of the HTML5 specification",
                                                        _sup._id("cite_ref-HTML5diffHTML4_7-1")
                                                            ._class("reference")
                                                            .Content(
                                                                _a._href("#cite_note-HTML5diffHTML4-7")
                                                                    .Content(
                                                                        "[6]"
                                                                    )
                                                            ),
                                                        " and HTML5 also better defines the processing for any invalid documents.",
                                                        _sup._id("cite_ref-:0_8-0")
                                                            ._class("reference")
                                                            .Content(
